import DefaultLayout from '../components/DefaultLayout';
import { Button, Col, Container, Row } from 'reactstrap';
import styles from './css/report.module.css'

export default function Report() {
    return (
        <DefaultLayout>
            <ReportIntroduction>
            </ReportIntroduction>
        </DefaultLayout>
    );
}

const ReportIntroduction = () => {
    return (
        <Container>
            <h1 className="display-3">Report a workplace concern</h1>
            <p className="lead">How it works:...</p>
            <iframe className={styles.qualtrics} src="https://ischooluw.co1.qualtrics.com/jfe/form/SV_aa67eixcMktPOmh"></iframe>
        </Container>
    );  
}
